<script language="javascript">
function highlight(Label) {
	window.status = Label;
	if (window.event.srcElement.className == "mstheme-horiz-navtxt-g") {
		window.event.srcElement.className = "mstheme-horiz-navtxt-gs";
		displaylabel(Label);
	}
	else if (window.event.srcElement.className == "mstheme-horiz-navtxt-gs") {
		window.event.srcElement.className = "mstheme-horiz-navtxt-g";
		displaylabel(Label);
	}
}

function reset() {
	window.status = "";
	if (window.event.srcElement.className == "mstheme-horiz-navtxt-gs") {
		window.event.srcElement.className = "mstheme-horiz-navtxt-g"
		displaylabel("");
	}
	else if (window.event.srcElement.className == "mstheme-horiz-navtxt-g") {
		window.event.srcElement.className = "mstheme-horiz-navtxt-gs";
		displaylabel("");
	}
}

function displaylabel(Label) {
	document.all.description.innerText = Label;
}

document.onmouseout = reset;
</script>
